import React, {useState} from 'react';
import {Navbar} from "../../components/forHome/navbar";
import EventsTable from "../../components/forAdmin/eventsTable";
import AddIcon from "@mui/icons-material/Add";
import {Fab} from "@mui/material";
import {Modal} from "react-bootstrap";
import AddEventForm from "../../components/forAdmin/addEventForm";
import Sidebar from "../../components/forAdmin/sidebar";
function Dashboard({user, isAuthenticated}) {

    const [isOpen, setIsOpen] = useState(false);
    const openModal = () => setIsOpen(true);
    const closeModal = () => setIsOpen(false);

    //setTimeout(protect, 120);

    /*function protect()
    {
        if (!isAuthenticated && user == null)
            return (<Navigate to={"/"}/>)
    }*/

    return (
        <div>
            <header>
                <Sidebar />
                <div
                    id="intro"
                    className="bg-image"
                    style={{
                        background: "#9198e5",
                        "height": "100vh"
                    }}
                >
                    <div className="mask text-white mt-4">
                        <div className="container">
                            <div className="mt-5">
                                <h2 className="text-center m-2">TravnikGO Events</h2>
                                <EventsTable/>
                            </div>
                        </div>
                    </div>
                </div>
            </header>
        </div>
    );
}

export default Dashboard;
